pragma solidity 0.4.18;
import "./Restrictor.sol";
import "../lib/odll/userManager.sol";

contract ScanApplicationWriter is Restrictor {

  function ScanApplicationWriter(address _dbAddress) public {
    require(_dbAddress != 0x0);
    dbAddress = _dbAddress;
  }

  function applyToScan(
    address patientId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber,
    uint quote,
    bytes32 comment
  )
    external
    onlyPermittedSmartContract
  {
    userManager.applyToScan(dbAddress, msg.sender, patientId, scanAppointmentId, patientScanAppointmentIndexNumber, quote, comment);
  }

  function acceptScanApplication (
    address dentistId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber,
    uint quote
  )
    external
    payable
    onlyPermittedSmartContract
  {
    if (msg.value < quote) {
      msg.sender.transfer(msg.value);
      return;
    }

    userManager.acceptScanApplication(dbAddress, dentistId, msg.sender, scanAppointmentId, patientScanAppointmentIndexNumber, msg.value);
  }

  function cancelScanApplication (
    address patientId,
    uint scanAppointmentId,
    uint patientScanAppointmentIndexNumber
  )
    external
  {
    userManager.cancelScanApplication(dbAddress, msg.sender, patientId, scanAppointmentId, patientScanAppointmentIndexNumber);
  }
}
